def recover_server_key(size):
	b64x = b'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789+/=\n'
	n = size - 1 - len(footer) - 1
	h = hashlib.new('sha256')
	private_key_content = b'\n' + footer + b'\n'
	h.update(n * b'#' + private_key_content)
	di = h.hexdigest()
	assert di in hashes_sha256

	# recover the private key char by char
	i = 1
	while i < n - len(header):
		# iterate over the exended b64 charset
		for c in b64x:
			c = chr(c).encode()
			text = (n - i) * b'#' + c + private_key_content
			h = hashlib.new('sha256')
			h.update(text)
			di = h.hexdigest()
			# this check is not precise but sufficent here
			if di in hashes_sha256:
				private_key_content = c + private_key_content
				break
		i += 1
	private_key_content = header + b'\n' + private_key_content
	print(private_key_content.decode(), end = '')
